import React from 'react';
import Post from '../MyPosts/Post';
import classes from '../../../css/Profile/MyPosts/MyPost.module.css';

const MyPosts = (props) => {

    //let postsEls = props.posts.map(post => <Post post={post.post} likes={post.likes} />);
    let postsEls = props.posts.map(post => <Post message={post.post} />);

    return (
        <div className={classes.entries}>
            <p>My posts</p>
            <div>
                <form>
                    <textarea></textarea>
                    <button>Отправить</button>
                </form>
            </div>
            {postsEls}
        </div>
    );
}

export default MyPosts;
